import React, { Component } from "react";
import { Row, Col, TextInput, Button, Icon } from "react-materialize";
class Profile extends Component {
    render() {

        return (
            <div>
                <h5>User Profile</h5>
                <form>
                    <Row>
                        <Col s={12} m={6} l={6} xl={6}>
                            <TextInput s={12} l={12} m={12} label='Name' name="name" />
                        </Col>
                        <Col s={12} m={6} l={6} xl={6}>
                            <TextInput
                                email
                                validate
                                disabled
                                s={12}
                                l={12}
                                m={12}
                                label='Email'

                            />
                        </Col>
                        <Col s={12} m={6} l={6} xl={6}>
                            <TextInput s={12} l={12} m={12} label='Phone' name="phone" />
                        </Col>
                    </Row>
                    <Row>
                        <h5>Change Password</h5>
                        <Col s={12} m={12} l={12} xl={12}>
                            <TextInput
                                password
                                s={12}
                                l={12}
                                m={12}
                                label='Current Password'
                                name="currentPassword"
                            />
                        </Col>
                        <Col s={12} m={6} l={6} xl={6}>
                            <TextInput
                                password
                                s={12}
                                l={12}
                                m={12}
                                label='New Password'
                                name="newPassword"
                            />
                        </Col>
                        <Col s={12} m={6} l={6} xl={6}>
                            <TextInput
                                password
                                s={12}
                                l={12}
                                m={12}
                                label='Repeat Password'
                                name="repeatPassword"
                            />
                        </Col>
                    </Row>
                    <Row>
                        <Button node='button' type='submit' waves='light'>
                            Update
                            <Icon right>send</Icon>
                        </Button>
                    </Row>
                </form>
            </div>
        );
    }
}

export default Profile;
